import React, { Component } from 'react';
import './Application.css';
import Header from '../header/Header';
import Footer from './Footer';


class Application extends Component{
  
render(){
     
    return (
        <div>
        <div className="Main_contain">
        <Header />
             <div className="form-container">
                <h1>Track Your Application Status</h1>
                <p>For security reasons,please answer the fields below to<br /> fetch your applications.</p>
                <form>
                    <li><input type="email" className="input-box" placeholder="APPLICATION ID"/></li>
                    <li><input type="number" className="input-box" placeholder="ENTER YOUR MOBILE NUMBER" /></li>
                    <h2><button type="submit" onClick={this.newId} className="button1">TRACK APPLICATION</button></h2>
                     <h5 className ="OR">OR</h5>
                     <button type="button2" className="button2">LOGIN</button>
                </form>
            </div>
       
        </div>
        <Footer />
        </div>
    )
}
}
export default Application;
